// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "./Token.sol";

contract Identity {
    struct UserInfo {
        string name;
        string email;
        string bio;
        string[] talents;
    }

    address public tokenContract;
    Token public tokens;

    uint256 public totalUserCount;
    address[] public userList;

    string[] public allowedTalents = [
        "Graphic Design",
        "Software Development",
        "Web Development",
        "Data Science",
        "Music Composition",
        "Marketing",
        "Content Writing",
        "Video Production",
        "Photography",
        "Sales",
        "Project Management",
        "Dance",
        "Yoga",
        "Teaching",
        "Woodworking",
        "Nutrition",
        "Personal Training",
        "Acting",
        "Fashion Design",
        "Cybersecurity",
        "Animation",
        "Illustration",
        "UI/UX Design",
        "Blockchain Development",
        "Game Development",
        "Copywriting",
        "SEO",
        "Social Media Management",
        "Event Planning",
        "Accounting",
        "Legal Services",
        "Interior Design",
        "Architecture",
        "Gardening",
        "Culinary Arts",
        "Makeup Artistry",
        "Mobile App Development",
        "Robotics",
        "Virtual Reality",
        "Augmented Reality",
        "Cryptocurrency Trading",
        "Forex Trading",
        "Options Trading",
        "Real Estate",
        "Electrical Engineering",
        "Mechanical Engineering",
        "Chemical Engineering",
        "Biomedical Engineering",
        "Environmental Science",
        "Meteorology",
