        "Game Design",
        "Health Coaching",
        "Life Coaching",
        "Financial Planning",
        "E-commerce",
        "Cryptocurrency Analysis",
        "Quantum Computing",
        "AI Development",
        "Machine Learning",
        "Quantitative Analysis",
        "Risk Management",
        "Blockchain Consulting"
    ];

    constructor(address _tokenContract) {
        tokenContract = _tokenContract;
        tokens = Token(tokenContract);
    }

    mapping(address => UserInfo) public users;

    function setUser(
        string memory _name,
        string memory _email,
        string memory _bio,
        string[] memory _talents
    ) public {
        UserInfo storage user = users[msg.sender];
        user.name = _name;
        user.email = _email;
        user.bio = _bio;
        user.talents = _talents;
        tokens.initializeUser(msg.sender);
        totalUserCount++;
        userList.push(msg.sender);
    }

    function getAllowedTalents() public view returns (string[] memory) {
        return allowedTalents;
    }

    function getUser(
        address _user
    )
        public
        view
        returns (
            string memory,
            string memory,
            string memory,
            string[] memory,
            uint256
        )
    {
        UserInfo storage user = users[_user];
        uint256 userTokens = tokens.balanceOf(_user);
        return (user.name, user.email, user.bio, user.talents, userTokens);
    }
}
